import React from 'react';
import logo from '../한강.png';

function Main() {
  let Name = "name"
  let des = "설명설명설명"
  let cost = 123
  let tokenlist = [{ logo, Name, des, cost }, { logo, Name, des, cost }]
  return (
    <div className="App">
      <div class="container">
        <div className="row no-gutters">
          {tokenlist.map((token) => {
            return (
              <div className="col-3">
                <svg
                  className="bd-placeholder-img"
                  width="100%"
                  height="250"
                  xmlns="http://www.w3.org/2000/svg"
                  aria-label="Placeholder: Image"
                  preserveAspectRatio="xMidYMid slice"
                  role="img">
                </svg>
                {/* <h1 className="title">NFT</h1> */}
                <div class="card">
                  <img class="card-img-top" src={logo} alt={"logo"} />
                  <div class="card-body">
                    <h5 class="card-title">{token.Name}</h5>
                    <p class="card-text">설명: {token.des} 가격: {token.cost}</p>
                    <a href="/" class="btn btn-primary">구매</a>
                  </div>
                </div>
              </div>


            )
          })}
        </div>
      </div>
    </div>
  );
}

export default Main;
